        return(
            <div>
                <AliceCarousel mouseDragEnabled >
      <img src={bg} onDragStart={handleOnDragStart} className="yours-custom-class" />
      <img src={bg2} onDragStart={handleOnDragStart} className="yours-custom-class" />
      <img src={b} onDragStart={handleOnDragStart} className="yours-custom-class" />
      <img src="/img4" onDragStart={handleOnDragStart} className="yours-custom-class" />
      <img src="/img5" onDragStart={handleOnDragStart} className="yours-custom-class" />
    </AliceCarousel>
            </div>
        );
    }
}

